import React, { Component } from "react";
import { Row } from "react-bootstrap";

export default class StartExamPage extends Component {
  state = {
    exam: [],
  };

  render() {
    return (
      <>
        <Row>
          <h1>This will be start exam page</h1>
        </Row>
        <Row>{this.state.map()}</Row>
      </>
    );
  }
}

componentdidMount = async () => {
  const resp = await fetch("http://localhost:3007/exam/start");
  {
    method: "POST";
  }

  if (resp.ok) {
    const exam = await resp.json();

    this.setState({ exam: exam });
  }
};
